import React from "react";
import {Link} from "react-router-dom";

const Navigation = () =>{
    return(
        <>
            <div>
                <ul>
                    <li><Link to="/">Home</Link></li>
                    <li><Link to="/about"/>About</li>
                    <li><Link to="/services"/>Register</li>
                    <li><Link to="/contact"/>Login</li>
                </ul>
            </div>
        </>
    );
}
export default Navigation;
